
import face_recognition
import json
import numpy as np
import sys


class MatchingFaces:
    def facesCompare(markFoundPrint,markMiassingPrint):
        markMiassingPrint_npArray=[]
        for row in markMiassingPrint:
            markMiassingPrint_npArray.append(np.array(row.get('print')))
        output=[]
        npArrayOfFound=[]
        for mainRow in markFoundPrint:
             faceDistances=face_recognition.face_distance(markMiassingPrint_npArray,np.array(row.get('print')))
             distance_count=0
             for subRow in markMiassingPrint:
                 output.append({
                         "found_id":mainRow.get("report_id"),
                         "missing_id":subRow.get("report_id"),
                         "found_print_id":mainRow.get("print_id"),
                         "missing_print_id":subRow.get("print_id"),
                         "distance":faceDistances[distance_count]
                         })
                 print(faceDistances[distance_count])
                 distance_count+=1
             npArrayOfFound.clear()
        return json.loads(json.dumps(output))   
        
    
            
  

if __name__ == "__main__":

    foundFace=str(sys.argv[1])
    allMissingFaces=str(sys.argv[2])
    output=MatchingFaces.facesCompare(foundFace,allMissingFaces)
    print (output)
    
    
    
    
